import { map } from '../../../styles/organization.module.scss'

import * as styles from '../../../styles/usable.module.scss'

function Selecta({ /* styleProp, */ selected, option }) {
  return (
    <select className={styles.select}>
      <option defaultValue={selected} value="" hidden>
        {selected}
      </option>
      {option &&
        option.values.map((opt) => {
          return (
            <option key={opt} value={opt}>
              {opt}
            </option>
          )
        })}
    </select>
  )
}

export default Selecta
